import React from 'react'
import { Table, Container, TabPane } from 'semantic-ui-react'

const TableData = ({data}) => {

    const keys = Object.keys(data[0]);
    const displayHeaders = keys.map( (head, i) => {
        return(
            <Table.HeaderCell key={i} >{head}</Table.HeaderCell>
        );
    });

    const displayBody = data.map( obj => {

        let val = Object.values(obj)
        val.map( (data, i) => {
            return (
                <Table.Cell key={i}>{data}</Table.Cell>
            )
        })
        return val;
    });

    console.log(Object.values(data[0]));

    return (
        <Container>
              <Table striped>
                <Table.Header>
                    <Table.Row>
                        {displayHeaders}
                    </Table.Row>
                </Table.Header>

                <Table.Body>
                    <Table.Row>
                        {displayBody}
                    </Table.Row>
                </Table.Body>
            </Table>
        </Container>
    );
}

export default TableData;
